import React, { Component } from 'react'
import './index.css'

export default class List extends Component {

	render() {
		const {users,isFirst,isLoading,err} = this.state
		return (
			<div className="row">
				<div className="card">
          <a rel="noreferrer" href='https://zyydgrbk.oss-cn-chengdu.aliyuncs.com/images/vue%E7%9C%81%E5%8E%BBextend%E6%AD%A5%E9%AA%A4%E5%AE%9E%E4%BE%8B.jpg' target="_blank">
            <img alt="head_portrait" src='https://zyydgrbk.oss-cn-chengdu.aliyuncs.com/images/vue%E7%9C%81%E5%8E%BBextend%E6%AD%A5%E9%AA%A4%E5%AE%9E%E4%BE%8B.jpg' style={{width:'100px'}}/>
          </a>
          <p className="card-text">'denglu'</p>
        </div>
			</div>
		)
	}
}
